import React from 'react'
import Link from 'next/link'
import fetch from 'isomorphic-unfetch';

const Index = props => (
  <div>
    <h1> Hello Chelsey </h1>
    <Link href='/about'><a>About</a></Link>
    <style jsx>{`
      h1 {
        color: 'red';
        font-weight: bold;
      }
    `}
    </style>
  </div>
)

